import React, { useState } from 'react';
import axios from 'axios';




const Pokemonapi = props => {
    const [responseDatas, setResponseData] = useState("");


    const callPokemonapi = () => {
        axios.get(`https://pokeapi.co/api/v2/pokemon/ditto`)
            .then(res => {
                setResponseData(res);
            })
            .catch(err => {
                console.log(err);
            });
    };



    return (
        <div>
            <button type="submit" onClick={callPokemonapi}>Fetch Pokemon</button>
            <div>
                {responseDatas.map((responseData, id) => {
                    return (
                        <Pokemonapi
                            key={id}
                            list={responseData}
                        />
                    )
                })}
            </div>
        </div>

    )
}

export default Pokemonapi;
